import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { useEffect } from "react";
import { asyncGetUser } from '../../actions/userActions'

const Profile = () => {

    const dispatch = useDispatch()

    useEffect(()=>{
        dispatch(asyncGetUser())
    }, [dispatch])

    const userData = useSelector(state=>state.user.user)

    return (
        <div>
            <h3>Profile Component</h3>
            <p></p>
            <p>Name</p> <b>{userData.username}</b>
            <p>Email</p> <b>{userData.email}</b>
            <p>Business Name</p> <b>{userData.businessName}</b>
            <p>Address</p> <b>{userData.address}</b>
            <p>Created on</p> <b>{userData.createdAt}</b>
        </div>
    )
}

export default Profile
